import React from 'react';
import PropTypes from 'prop-types';

const Header = (props) => {
    const {branding} = props;
  return (
    <div>
      <h1 style = {headingStyle}>{branding}</h1>
    </div>
  )
};
Header.defaultProps = {
    branding: 'My App'
};

Header.prototype = {
    branding: PropTypes.string.isRequired
};

const headingStyle = {
    color:'gr', 
    fontSize: '50px'
}
export default Header;
